import * as React from "react";

function Prof(props) {
  return (
    <>
      <div className="div">
        <div className="div-1">
          <div className="div-2">
            <div className="div-3">Classroom Insights</div>
            <div className="div-4">Today's attendance at a glance.</div>
            <div className="div-5">Mark Attendance</div>
          </div>
        </div>
        <div className="div-6">
          <div className="div-7">Attendance Overview</div>
          <div className="div-4">Hsitory attendance </div>
        </div>
      </div>
      <style jsx="true">{`
        html,
        body {
          width: 100%;
          height: 100vh;
        }
        .div {
          background-color: #fff;
          display: flex;
          flex-direction: column;
        }
        .div-1 {
          justify-content: center;
          align-items: center;
          background-color: #222831;
          display: flex;
          width: 100%;
          color: #fff;
          text-align: center;
          padding: 50px 60px;
        }
        @media (max-width: 991px) {
          .div-1 {
            max-width: 100%;
            padding: 0 20px;
          }
        }
        .div-2 {
          display: flex;
          width: 840px;
          max-width: 100%;
          flex-direction: column;
          margin: 102px 0 46px;
        }
        @media (max-width: 991px) {
          .div-2 {
            margin: 40px 0;
          }
        }
        .div-3 {
          -webkit-box-orient: vertical;
          -webkit-line-clamp: 3;
          color: #eee;
          text-overflow: ellipsis;
          letter-spacing: -1.34px;
          margin-top: 32px;
          font: 700 67px/104% Inter, -apple-system, Roboto, Helvetica,
            sans-serif;
        }
        @media (max-width: 991px) {
          .div-3 {
            max-width: 100%;
            font-size: 40px;
          }
        }
        .div-4 {
          margin-top: 16px;
          font: 400 22px/130% Inter, -apple-system, Roboto, Helvetica,
            sans-serif;
        }
        @media (max-width: 991px) {
          .div-4 {
            max-width: 100%;
          }
        }
        .div-5 {
          max-width: 100%;
          justify-content: center;
          align-items: center;
          align-self: center;
          border-radius: 8px;
          background-color: #008a90;
          margin-top: 40px;
          width: 360px;
          white-space: nowrap;
          padding: 16px 60px;
          font: 600 18px/140% Inter, -apple-system, Roboto, Helvetica,
            sans-serif;
        }
        @media (max-width: 991px) {
          .div-5 {
            white-space: initial;
            padding: 0 20px;
          }
        }

        .div-6 {
          justify-content: center;
          align-items: center;
          background-color: #222831;
          display: flex;
          margin-top: 64px;
          width: 100%;
          flex-direction: column;
          color: #eee;
          padding: 50px 40px;
        }
        @media (max-width: 991px) {
          .div-6 {
            max-width: 100%;
            margin-top: 40px;
            padding: 50px 20px;
          }
        }
        .div-7 {
          justify-content: center;
          align-items: center;
          -webkit-box-orient: vertical;
          -webkit-line-clamp: 3;
          text-overflow: ellipsis;
          letter-spacing: -1.02px;
          margin-top: 70px;
          font: 700 51px/120% Inter, -apple-system, Roboto, Helvetica,
            sans-serif;
        }
        @media (max-width: 991px) {
          .div-7 {
            justify-content: center;
            align-items: center;
            max-width: 100%;
            margin-top: 40px;
            font-size: 40px;
          }
        }
      `}</style>
    </>
  );
}
export default Prof;
